import React from 'react';
import search from './images/search_icon.png';
import Menu from './images/Menu.png';
import Einstellung from './images/Einstellungen.png';
import Info from './images/Info1.png';
import stud from './images/shortcut-stud.png';
import team from './images/shortcut-teams.png';
import ITLogo from './images/IT-Designer.png';
import './App.css';
const NeueSeite = () => {
  return (
    <div className="Teams">
        <header className="Homepage-header">    
            <img src={Menu} className="Menu" alt="menu" />  
            <img src={Info} className="Info" alt="info" />
    
            <img src={Einstellung} className="Einstellung" alt="settings" />
        </header>
        <div className="title">
            <b>Teams</b>
        </div>
        <div className="search-bar">
            <img src={search} className="search-icon" alt="search" />
        </div>
        <div className="team-field">
            <div className="team1">
            <div className='group'>
            </div>
        </div>
        <div className="team2">
          
        </div>
        <div className="team3">
        </div>
        <div className="team4">
        </div>
        <div className="team5">
        </div>
        <div className="team6">
        </div>
      </div>
    </div>
  );
};

export default NeueSeite;
